INSERT INTO `fanwe_article` VALUES ('77', '项目规范', '<b>项目规范</b><br />\r\n<br />\r\n本众筹系统是中国最专业的众筹系统服务提供商，帮您在一天内快速搭建众筹平台。<br />\r\n<br />\r\n系统咨询热线： <br />\r\n<br />\r\n以下是众筹网站发布项目的基本要求，不合要求的项目，将会被拒绝或删除。如果你有疑问，可以通过邮件或电话联系我们。 <br />\r\n<br />\r\n<br />\r\n附注：某些规范会随着时间而更新或者调整，会导致一些旧项目并不能完全符合最新规范。<br />\r\n<br />\r\n项目发布团队资格：<br />\r\n&nbsp;&nbsp;&nbsp; （团队中必须有至少一名成员满足以下条件）<br />\r\n&nbsp;&nbsp;&nbsp; 18周岁以上;<br />\r\n&nbsp;&nbsp;&nbsp; 中华人民共和国公民;<br />\r\n&nbsp;&nbsp;&nbsp; 拥有能够在中国地区接收人民币汇款的银行卡或者支付宝、财付通账户;<br />\r\n&nbsp;&nbsp;&nbsp; 提供必要的身份认证和资质认证，根据项目内容，有可能包括但不限于：身份证，护照，学历证明等;<br />\r\n&nbsp;&nbsp;&nbsp; 其他跟项目发布、执行需求、渠道销售相关的必须条件。<br />\r\n项目发布：<br />\r\n&nbsp;&nbsp;&nbsp; 根据相关法律法规，项目发布申请提交后，须经过众筹网站工作人员审核后才能发布;<br />\r\n&nbsp;&nbsp;&nbsp; 根据项目的内容，众筹网站会要求项目发布团队提供相关材料，证明项目的可行性，以及项目发布团队的执行能力;<br />\r\n&nbsp;&nbsp;&nbsp; 众筹网站对提交上线审核的项目是否拥有上线资格具有最终决定权;<br />\r\n&nbsp;&nbsp;&nbsp; 项目在众筹网站上线预售期间，不能在中国大陆其他相似平台（包括但不限于众筹网站、电商网站、及其他形式网店等）同时发布。一经发现将立即下线处 理，其项目上线期间所获得的金额将被立即退回给预订用户在众筹网站上的账户中。<br />\r\n<br />\r\n项目内容规范（不符合以下内容规范的项目将被退回）：<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; 1. 只允许尚未正式对外发布的项目在众筹网站上线。项目在众筹网站上线之前，不能在中国大陆其他相似平台（包括但不限于众筹网站、电商网站、及其 他形式网店等）或媒体发布。<br />\r\n&nbsp;&nbsp;&nbsp; 2. 项目必须为智能项目。智能项目的定义为：设备必须可采集数据、联网联动，并提供自动化的服务。单纯有设计感的非智能项目暂时无法通过审核。<br />\r\n&nbsp;&nbsp;&nbsp; 3. 项目发布方必须在项目上线前提供无bug的实物试产样机，由众筹网站工作人员进行盲测确保没有问题才能正式上线。<br />\r\n&nbsp;&nbsp;&nbsp; 4. 项目内容介绍框架必须包含“项目介绍”、“团队介绍”、“研发进展”等重要板块。<br />\r\n&nbsp;&nbsp;&nbsp; 5. 项目软硬件设计必须完整、合理、具有可行性；有完整的计划和执行能力，且图片、视频不能借用或盗用非自行拍摄的内容。<br />\r\n&nbsp;&nbsp;&nbsp; 6. 项目发布团队必须有明确的生产计划及售后服务计划，尚不确定是否会量产的项目不符合首次发布的标准皆不能上线。<br />\r\n&nbsp;&nbsp;&nbsp; 7. 提交申请的项目必须能符合如下分类：医疗健康、家居生活、出行定位、影音娱乐、科技外设。<br />\r\n&nbsp;&nbsp;&nbsp; 8. 以下类别的项目或内容将不被允许在此发布或作为给预订用户的附加回报：<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; 烟、酒相关<br />\r\n&nbsp;&nbsp;&nbsp; 洗浴、美容或化妆项目相关<br />\r\n&nbsp;&nbsp;&nbsp; 毒品、类似毒品的物质、吸毒用具、烟等相关<br />\r\n&nbsp;&nbsp;&nbsp; 枪支、武器和刀具相关<br />\r\n&nbsp;&nbsp;&nbsp; 营养补充剂相关<br />\r\n&nbsp;&nbsp;&nbsp; 色情、保健、性用品内容相关<br />\r\n&nbsp;&nbsp;&nbsp; 房地产相关<br />\r\n&nbsp;&nbsp;&nbsp; 饮食类相关<br />\r\n&nbsp;&nbsp;&nbsp; 财政奖励(所有权、利润份额、还款贷款等)<br />\r\n&nbsp;&nbsp;&nbsp; 多级直销和传销类相关<br />\r\n&nbsp;&nbsp;&nbsp; 令人反感的内容(仇恨言论、不适当内容等)<br />\r\n&nbsp;&nbsp;&nbsp; 支持或反对政治党派的项目<br />\r\n&nbsp;&nbsp;&nbsp; 推广或美化暴力行为的项目<br />\r\n&nbsp;&nbsp;&nbsp; 对奖、彩票和抽奖活动相关<br />\r\n&nbsp;&nbsp;&nbsp; 股权、债券、分红、利息等形式的附加回报<br />\r\n&nbsp;&nbsp;&nbsp; 与首发项目无关的附加回报<br />\r\n&nbsp;&nbsp;&nbsp; 以其他无可行、不合理的承诺作为附加回报<br />\r\n举报及推荐标准：<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; 举报：不符合《项目内容规范》<br />\r\n&nbsp;&nbsp;&nbsp; 合格：符合《项目内容规范》<br />\r\n&nbsp;&nbsp;&nbsp; 推荐：合格并且满足下列标准中的任意1-3项（含3项），视为推荐<br />\r\n&nbsp;&nbsp;&nbsp; 强烈推荐：合格并且满足下列标准中的任意3项以上，视为强烈推荐<br />\r\n&nbsp;&nbsp;&nbsp; 1. 项目定位清晰，功能逻辑性强、完整且条理清晰、团队对研发和生产有完整的计划和管控能力，有相关的图片和视频（图片、视频不能借用或盗用非 本人/公司拍摄的）<br />\r\n&nbsp;&nbsp;&nbsp; 2. 项目符合时下趋势、有热点，具备可传播性<br />\r\n&nbsp;&nbsp;&nbsp; 3. 项目本身有创意、创新；非山寨、抄袭、跟风；市面上无同类相似项目<br />\r\n&nbsp;&nbsp;&nbsp; 4. 项目设计感好，有品质，符合大众审美喜好的要求<br />\r\n&nbsp;&nbsp;&nbsp; 5. 项目发布团队有一定的推广渠道、媒体资源、或在公众平台上有一定的影响力<br />\r\n&nbsp;&nbsp;&nbsp; 6. 项目发布团队的话题运营能力出众，与粉丝互动积极正面，能调动起网友的兴趣和参与感<br />\r\n<br />', '24', '1413588165', '1413588165', '0', '1', '', '0', '0', '0', '9', '', '', '', '', '', '', '1', '1', '');
INSERT INTO `fanwe_article` VALUES ('74', '10.21第一期天使合投SHOW热辣登场！', '<p>\r\n  本协会精心策划“天使合投SHOW”，期待您的光临！\r\n</p>\r\n<p>\r\n  <strong>活动时间：</strong><span style=\"color:#ff0000;\">2014年10月21日（下周二） 14:00-17:30</span>\r\n</p>\r\n<p>\r\n <strong>活动地点：</strong>科技园科技大厦B座1层\r\n</p>\r\n<strong>协办及支持单位：</strong>\r\n<p>\r\n <strong>参与投资机构：</strong>\r\n</p>\r\n<p>\r\n <strong>活动人数：</strong>50-60人\r\n</p>\r\n<p>\r\n <embed src=\"http://player.youku.com/player.php/Type/Folder/Fid/23426380/Ob/1/sid/XODg1NDA0NzQ0/v.swf\" type=\"application/x-shockwave-flash\" width=\"550\" height=\"400\" autostart=\"false\" loop=\"true\" />\r\n</p>\r\n<p>\r\n <strong><span style=\"background-color:#ffff00;\">分享嘉宾及主题</span></strong>\r\n</p>\r\n<p>\r\n  <img src=\"./public/attachment/201410/17/16/5440d8025b024.jpg\" alt=\"\" border=\"0\" />\r\n</p>\r\n<br />\r\n<p>\r\n <strong><span style=\"background-color:#ffff00;\">活动流程：</span></strong>\r\n</p>\r\n<p>\r\n  14:00 活动开始\r\n</p>\r\n<br />\r\n<p>\r\n <br />\r\n</p>\r\n<p>\r\n <strong><span style=\"background-color:#ffff00;\">报名方法：</span></strong>\r\n</p>\r\n<p>\r\n  邮件： 请注明姓名、机构、职务\r\n</p>\r\n<p>\r\n  电话：方维服务 400-600-5505 请注明姓名、机构、职务\r\n</p>', '25', '1413506986', '1422902943', '0', '1', '', '0', '0', '0', '6', '', '', '', '', '', '', '1', '1', '');
INSERT INTO `fanwe_article` VALUES ('75', '使用条款', '使用条款<br />\r\n接受条款<br />\r\n<br />\r\n本站所提供的服务包含众筹网体验和使用、众筹网互联网消息传递服务以及众筹网提供的与众筹网有关的任何其他特色功能、内容或应用程序(合称\"众筹网服务\")。<br />\r\n<br />\r\n无论用户是以\"访客\"(表示用户只是浏览众筹网)还是\"成员\"(表示用户已在众筹网注册并登录)的身份使用众筹网服务，均表示该用户同意遵守本使用协议。<br />\r\n<br />\r\n如 果用户自愿成为众筹网成员并与其他成员交流(包括通过众筹网直接联系或通过众筹网各种服务而连接到的成员)，以及使用众筹网及其各种附加服务，请 务必认真阅读本协议并在注册过程中表明同意接受本协议。本协议的内容包含众筹网关于接受众筹网服务和在众筹网上发布内容的规定、用户使用众筹网服务所享有 的权利、承担的义务和对使用众筹网服务所受的限制、以及众筹网的隐私条款。<br />\r\n<br />\r\n如果用户选择使用某些众筹网服务，可能会收到要求其下载软件或内容的通知，和或要求用户同意附加条款和条件的通知。除非用户选择使用的众筹网服务相关的附加条款和条件另有规定，附加的条款和条件都应被包含于本协议中。<br />\r\n<br />\r\n有权随时修改本协议文本中的任何条款。一旦众筹网对本协议进行修改, 众筹网将会以公告形式发布通知。任何该等修改自发布之日起生效。如果用户在该等修改发布后继续使用众筹网服务，则表示该用户同意遵守对本协议所作出的该等 修改。因此，请用户务必定期查阅本协议，以确保了解所有关于本协议的最新修改。如果用户不同意众筹网对本协议进行的修改，请用户离开众筹网并立即停止使用 众筹网服务。同时，用户还应当删除个人档案并注销成员资格。<br />\r\n<br />\r\n遵守法律<br />\r\n<br />\r\n当使用众筹网服务时，用户同意遵守中华人民共和国 (下称\"中国\")的相关法律法规，包括但不限于《中华人民共和国宪法》、《中华人民共和国合同 法》、《中华人民共和国电信条例》、《互联网信息服务管理办法》、《互联网电子公告服务管理规定》、《中华人民共和国保守国家秘密法》、《全国人民代表大 会常务委员会关于维护互联网安全的决定》、《中华人民共和国计算机信息系统安全保护条例》、《计算机信息网络国际联网安全保护管理办法》、《中华人民共和 国著作权法》及其实施条例、《互联网著作权行政保护办法》等。用户只有在同意遵守所有相关法律法规和本协议时，才有权使用众筹网服务(无论用户是否有意访 问或使用此服务)。请用户仔细阅读本协议并将其妥善保存。<br />\r\n<br />\r\n用户帐号、密码及安全<br />\r\n<br />\r\n用户应提供及时、详尽、准确的个人资 料，并不断及时更新注册时提供的个人资料，保持其详尽、准确。所有用户输入的资料将引用为注册资料。众筹网不对因用户提交的注册信息不真实或未及时准确变 更信息而引起的问题、争议及其后果承担责任。 用户不应将其帐号、密码转让、出借或告知他人，供他人使用。如用户发现帐号遭他人非法使用，应立即通知众筹网。因黑客行为或用户的保管疏忽导致帐号、密码 遭他人非法使用的，众筹网不承担任何责任。<br />\r\n<br />\r\n隐私权政策<br />\r\n<br />\r\n用户提供的注册信息及众筹网保留的用户所有资料将受到中国相关法律法规和众筹网《隐私权政策》的规范。《隐私权政策》构成本协议不可分割的一部分。<br />\r\n<br />\r\n上传内容<br />\r\n<br />\r\n用 户通过任何众筹网提供的服务上传、张贴、发送(通过电子邮件或任何其它方式传送)的文本、文件、图像、照片、视频、声音、音乐、其他创作作品或任 何其他材料(以下简称\"内容\"，包括用户个人的或个人创作的照片、声音、视频等)，无论系公开还是私下传播，均由用户和内容提供者承担责任，众筹网不对该 等内容的正确性、完整性或品质作出任何保证。用户在使用众筹网服务时，可能会接触到令人不快、不适当或令人厌恶之内容，用户需在接受服务前自行做出判断。 在任何情况下，众筹网均不为任何内容负责(包括但不限于任何内容的错误、遗漏、不准确或不真实)，亦不对通过众筹网服务上传、张贴、发送(通过电子邮件或 任何其它方式传送)的内容衍生的任何损失或损害负责。众筹网在管理过程中发现或接到举报并进行初步调查后，有权依法停止任何前述内容的传播并采取进一步行 动，包括但不限于暂停某些用户使用众筹网的全部或部分服务，保存有关记录，并向有关机关报告。<br />\r\n<br />\r\n用户行为<br />\r\n<br />\r\n用户在使用众筹网服务时，必须遵守中华人民共和国相关法律法规的规定，用户保证不会利用众筹网服务进行任何违法或不正当的活动，包括但不限于下列行为：<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; 上传、展示、张贴或以其它方式传播含有下列内容之一的信息：<br />\r\n&nbsp;&nbsp;&nbsp; 反对宪法及其他法律的基本原则的;<br />\r\n&nbsp;&nbsp;&nbsp; 危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的;<br />\r\n&nbsp;&nbsp;&nbsp; 损害国家荣誉和利益的;<br />\r\n&nbsp;&nbsp;&nbsp; 煽动民族仇恨、民族歧视、破坏民族团结的;<br />\r\n&nbsp;&nbsp;&nbsp; 破坏国家宗教政策，宣扬邪教和封建迷信的;<br />\r\n&nbsp;&nbsp;&nbsp; 散布谣言，扰乱社会秩序，破坏社会稳定的;<br />\r\n&nbsp;&nbsp;&nbsp; 散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的;<br />\r\n&nbsp;&nbsp;&nbsp; 侮辱或者诽谤他人，侵害他人合法权利的;<br />\r\n&nbsp;&nbsp;&nbsp; 含有虚假、有害、胁迫、侵害他人隐私、骚扰、中伤、粗俗、猥亵、或其它道德上令人反感的内容;<br />\r\n&nbsp;&nbsp;&nbsp; 含有中国法律、法规、规章、条例以及任何具有法律效力的规范所限制或禁止的其它内容的;<br />\r\n&nbsp;&nbsp;&nbsp; 不得为任何非法目的而使用网络服务系统;<br />\r\n&nbsp;&nbsp;&nbsp; 用户同时保证不会利用众筹网服务从事以下活动：<br />\r\n&nbsp;&nbsp;&nbsp; 未经允许，进入计算机信息网络或者使用计算机信息网络资源的;<br />\r\n&nbsp;&nbsp;&nbsp; 未经允许，对计算机信息网络功能进行删除、修改或者增加的;<br />\r\n&nbsp;&nbsp;&nbsp; 未经允许，对进入计算机信息网络中存储、处理或者传输的数据和应用程序进行删除、修改或者增加的;故意制作、传播计算机病毒等破坏性程序的;<br />\r\n&nbsp;&nbsp;&nbsp; 其他危害计算机信息网络安全的行为。<br />\r\n<br />\r\n如用户在使用网络服务时违反任何上述规定，众筹网或经其授权者有权要求该用户改正或直接采取一切必要措施(包括但不限于更改、删除相关内容、暂停或终止相关用户使用众筹网服务)以减轻和消除该用户不当行为造成的影响。<br />\r\n<br />\r\n用户不得对众筹网服务的任何部分或全部以及通过众筹网取得的任何形式的信息，进行复制、拷贝、出售、转售或用于任何其它商业目的。<br />\r\n<br />\r\n用户须对自己在使用众筹网服务过程中的行为承担法律责任。用户承担法律责任的形式包括但不限于：停止侵害行为，向受到侵害者公开赔礼道歉，恢复受到 侵害者的名誉，对受到侵害者进行赔偿。如果众筹网网站因某用户的非法或不当行为受到行政处罚或承担了任何形式的侵权损害赔偿责任，该用户应向众筹网进行赔 偿(不低于众筹网向第三方赔偿的金额)并通过全国性的媒体向众筹网公开赔礼道歉。<br />\r\n<br />\r\n知识产权和其他合法权益(包括但不限于名誉权、商誉等)<br />\r\n<br />\r\n并不对用户发布到众筹网服务中的文本、文件、图像、照片、视频、声音、音乐、其他创作作品或任何其他材料(前文称为\"内容\")拥有任何所有 权。在用户将内容发布到众筹网服务中后，用户将继续对内容享有权利，并且有权选择恰当的方式使用该等内容。如果用户在众筹网服务中或通过众筹网服务展示或 发表任何内容，即表明该用户就此授予众筹网一个有限的许可以使众筹网能够合法使用、修改、复制、传播和出版此类内容。<br />\r\n<br />\r\n用户同意其已在服务所发布的内容，授予众筹网可以免费的、永久有效的、不可撤销的、非独家的、可转授权的、在全球范围内对所发布内容进行使 用、复制、修改、改写、改编、发行、翻译、创造衍生性著作的权利，及/或可以将前述部分或全部内容加以传播、表演、展示，及/或可以将前述部分或全部内容 放入任何现在已知和未来开发出的以任何形式、媒体或科技承载的著作当中。<br />\r\n<br />\r\n用户声明并保证：用户对其在众筹网服务中或通过众筹网服务发布 的内容拥有合法权利;用户在众筹网服务中或通过众筹网服务发布的内容不侵犯任何人的肖 像权、隐私权、著作权、商标权、专利权、及其它合同权利。如因用户在众筹网服务中或通过众筹网服务发布的内容而需向其他任何人支付许可费或其它费用，全部 由该用户承担。<br />\r\n<br />\r\n众筹网服务中包含众筹网提供的内容，包含用户和其他众筹网许可方的内容(下称\"众筹网的内容\")。众筹网的内容受《中华 人民共和国著作权法》、《中 华人民共和国商标法》、《中华人民共和国专利法》、《中华人民共和国反不正当竞争法》和其他相关法律法规的保护，众筹网拥有并保持对众筹网的内容和众筹网 服务的所有权利。<br />\r\n<br />\r\n国际使用之特别警告<br />\r\n<br />\r\n用户已了解国际互联网的无国界性，同意遵守所有关于网上行为、内容的法律法规。用户特别同意遵守有关从中国或用户所在国家或地区输出信息所可能涉及、适用的全部法律法规。<br />\r\n<br />\r\n项目筹款<br />\r\n<br />\r\n是一个让用户(即“项目发起人”)通过提供回报向支持者筹集资金的平台。您作为项目发起人，社会大众可以与您订立合同，在众筹网创建筹款项 目。您作为支持者，可以接受项目发起人和您之间的回报和契约，以赞助项目发起人的筹款项目。众筹网并不是支持者和项目发起人中的任何一方。所有交易仅存在 于用户和用户之间。<br />\r\n<br />\r\n通过众筹网支持项目，您须同意并遵守以下协议，包括如下条款：<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; 支持者同意接受在其承诺支持某项目时提供付款授权信息 。<br />\r\n&nbsp;&nbsp;&nbsp; 支持者同意众筹网及其合作伙伴授权或保留收费的权利。<br />\r\n&nbsp;&nbsp;&nbsp; 回报预期的完成日期并非约定实现的期限，它仅为项目发起人希望实现的日期。<br />\r\n&nbsp;&nbsp;&nbsp; 为建立良好的信用和名声，项目发起人会尽力依照预期完成日期实现项目。<br />\r\n&nbsp;&nbsp;&nbsp; 对于所有项目，众筹网将提供所有支持者的用户名称和联系方式给于项目发起人。项目成功时，众筹网将额外提供支持者的姓名、联系方式和邮寄地址等信息给于项目发起人。<br />\r\n&nbsp;&nbsp;&nbsp; 项目发起人可以在项目成功后直接向支持者要求额外信息。为了顺利获得回报，支持者须同意在合理期限内提供给项目发起人相关信息。<br />\r\n&nbsp;&nbsp;&nbsp; 如活动难以进行或无法满足回报需求时，项目发起人可应支持者的请求而退款 。<br />\r\n&nbsp;&nbsp;&nbsp; 项目发起人须满足项目成功后支持者的回报需求，或在无法实现的情况下退款。<br />\r\n&nbsp;&nbsp;&nbsp; 众筹网保留随时以任何理由取消项目的权利。<br />\r\n&nbsp;&nbsp;&nbsp; 众筹网有权随时以任何理由拒绝、取消、中断、删除或暂停该项目。众筹网不因该行为承担任何赔偿。众筹网的政策并非评论此类行为的理由。<br />\r\n&nbsp;&nbsp;&nbsp; 在项目成功和获得款项之间可能存在延迟。<br />\r\n<br />\r\n不承担任何相关回报或使用服务产生的损失或亏损。众筹网无义务介入任何用户之间的纠纷，或用户与其他第三方就服务使用方面产生的纠纷。包括但 不限于货物及服务的交付，其他条款、条件、保证或与网站活动相关联的有关陈述。众筹网不负责监督项目的实现与严格执行。您可授权众筹网、其工作人员、职 员、代理人及对损失索赔权的继任者所有已知或未知、公开或秘密的解决争议的方法和服务。<br />\r\n<br />\r\n费用和付款<br />\r\n<br />\r\n加入众筹网免费，但是我们对于某些服务是收取费用的。当您使用某项服务时，您将有机会看到您需要支付费用的项目，费用的变化在我们在网站上为您公开后生效。您负责支付使用该服务产生的所有费用和税款。<br />\r\n<br />\r\n向支持者筹集的资金通过第三方支付平台支付，众筹网对第三方支付平台的支付性能不承担责任。<br />\r\n<br />\r\n赔偿<br />\r\n<br />\r\n由 于用户通过众筹网服务上传、张贴、发送或传播的内容，或因用户与本服务连线，或因用户违反本使用协议，或因用户侵害他人任何权利而导致任何第三人 向众筹网提出赔偿请求，该用户同意赔偿众筹网及其股东、子公司、关联企业、代理人、品牌共有人或其它合作伙伴相应的赔偿金额(包括众筹网支付的律师费 等)，以使众筹网的利益免受损害。<br />\r\n<br />\r\n关于使用及储存的一般措施<br />\r\n<br />\r\n用户承认众筹网有权制定关于服务使用的一般措施及限制，包括 但不限于众筹网服务将保留用户的电子邮件信息、用户所张贴内容或其它上载内容的最长保留 期间、用户一个帐号可收发信息的最大数量、用户帐号当中可收发的单个信息的大小、众筹网服务器为用户分配的最大磁盘空间，以及一定期间内用户使用众筹网服 务的次数上限(及每次使用时间之上限)。通过众筹网服务存储或传送的任何信息、通讯资料和其它任何内容，如被删除或未予储存，用户同意众筹网毋须承担任何 责任。用户亦同意，超过一年未使用的帐号，众筹网有权关闭。众筹网有权依其自行判断和决定，随时变更相关一般措施及限制。<br />\r\n<br />\r\n服务的修改<br />\r\n<br />\r\n用 户了解并同意，无论通知与否，众筹网有权于任何时间暂时或永久修改或终止部分或全部众筹网服务，对此，众筹网对用户和任何第三人均无需承担任何责 任。用户同意，所有上传、张贴、发送到众筹网的内容，众筹网均无保存义务，用户应自行备份。众筹网不对任何内容丢失以及用户因此而遭受的相关损失承担责 任。<br />\r\n<br />\r\n终止服务<br />\r\n<br />\r\n用户同意众筹网可单方面判断并决定，如果用户违反本使用协议或用户长时间未能使用其帐号，众筹网可以终止该 用户的密码、帐号或某些服务的使用，并可 将该用户在众筹网服务中留存的任何内容加以移除或删除。众筹网亦可基于自身考虑，在通知或未通知之情形下，随时对该用户终止部分或全部服务。用户了解并同 意依本使用协议，无需进行事先通知，众筹网可在发现任何不适宜内容时，立即关闭或删除该用户的帐号及其帐号中所有相关信息及文件，并暂时或永久禁止该用户 继续使用前述文件或帐号。<br />\r\n<br />\r\n与广告商进行的交易<br />\r\n<br />\r\n用户通过众筹网服务与广告商进行任何形式的通讯或商业往来，或参与促销活 动(包括相关商品或服务的付款及交付)，以及达成的其它任何条款、条件、保 证或声明，完全是用户与广告商之间的行为。除有关法律法规明文规定要求众筹网承担责任外，用户因前述任何交易、沟通等而遭受的任何性质的损失或损害，均不予负责。<br />\r\n<br />\r\n链接<br />\r\n<br />\r\n用户了解并同意，对于众筹网服务或第三人提供的其它网站或资源的链接是否可以利用，众筹网不予负 责；存在或源于此类网站或资源的任何内容、广告、产 品或其它资料，众筹网亦不保证或负责。因使用或信赖任何此类网站或资源发布的或经由此类网站或资源获得的任何商品、服务、信息，如对用户造成任何损害，不负任何直接或间接责任。<br />\r\n<br />\r\n禁止商业行为<br />\r\n<br />\r\n用户同意不对众筹网服务的任何部分或全部以及用户通过众筹网的服务取得的任何物品、服务、信息等，进行复制、拷贝、出售、转售或用于任何其它商业目的。<br />\r\n<br />\r\n众筹网的专属权利<br />\r\n<br />\r\n用 户了解并同意，众筹网服务及其所使用的相关软件(以下简称\"服务软件\")含有受到相关知识产权及其它法律保护的专有保密资料。用户同时了解并同 意，经由众筹网服务或广告商向用户呈现的赞助广告或信息所包含之内容，亦可能受到著作权、商标、专利等相关法律的保护。未经众筹网或广告商书面授权，用户 不得修改、出售、传播部分或全部服务内容或软件，或加以制作衍生服务或软件。众筹网仅授予用户个人非专属的使用权，用户不得(也不得允许任何第三人)复 制、修改、创作衍生著作，或通过进行还原工程、反向组译及其它方式破译原代码。用户也不得以转让、许可、设定任何担保或其它方式移转服务和软件的任何权 利。用户同意只能通过由众筹网所提供的界面而非任何其它方式使用众筹网服务。<br />\r\n<br />\r\n担保与保证<br />\r\n<br />\r\n众筹网使用协议的任何规定均不 会免除因众筹网造成用户人身伤害或因故意造成用户财产损失而应承担的任何责任。 用户使用众筹网服务的风险由用户个人承担。众筹网对服务不提供任何明示或默示的担保或保证，包括但不限于商业适售性、特定目的的适用性及未侵害他人权利等 的担保或保证。<br />\r\n<br />\r\n众筹网亦不保证以下事项：<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; 服务将符合用户的要求；<br />\r\n&nbsp;&nbsp;&nbsp; 服务将不受干扰、及时提供、安全可靠或不会出错；<br />\r\n&nbsp;&nbsp;&nbsp; 使用服务取得的结果正确可靠；<br />\r\n&nbsp;&nbsp;&nbsp; 用户经由众筹网服务购买或取得的任何产品、服务、资讯或其它信息将符合用户的期望，且软件中任何错误都将得到更正。<br />\r\n&nbsp;&nbsp;&nbsp; 用户应自行决定使用众筹网服务下载或取得任何资料且自负风险，因任何资料的下载而导致的用户电脑系统损坏或数据流失等后果，由用户自行承担。<br />\r\n&nbsp;&nbsp;&nbsp; 用户经由众筹网服务获知的任何建议或信息(无论书面或口头形式)，除非使用协议有明确规定，将不构成众筹网对用户的任何保证。<br />\r\n<br />\r\n责任限制<br />\r\n<br />\r\n用户明确了解并同意，基于以下原因而造成的任何损失，众筹网均不承担任何直接、间接、附带、特别、衍生性或惩罚性赔偿责任(即使众筹网事先已被告知用户或第三方可能会产生相关损失)：<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; 众筹网服务的使用或无法使用；<br />\r\n&nbsp;&nbsp;&nbsp; 通过众筹网服务购买、兑换、交换取得的任何商品、数据、服务、信息，或缔结交易而发生的成本；<br />\r\n&nbsp;&nbsp;&nbsp; 用户的传输或数据遭到未获授权的存取或变造；<br />\r\n&nbsp;&nbsp;&nbsp; 任何第三方在众筹网服务中所作的声明或行为；<br />\r\n&nbsp;&nbsp;&nbsp; 与众筹网服务相关的其它事宜，但本使用协议有明确规定的除外。<br />\r\n<br />\r\n一般性条款<br />\r\n<br />\r\n本使用协议构成用户与众筹网之间的正式协议，并用于规范用户的使用行为。在用户使用众筹网服务、使用第三方提供的内容或软件时，在遵守本协议的基础上，亦应遵守与该等服务、内容、软件有关附加条款及条件。<br />\r\n<br />\r\n本使用协议及用户与众筹网之间的关系，均受到中华人民共和国法律管辖。<br />\r\n<br />\r\n用户与众筹网就服务本身、本使用协议或其它有关事项发生的争议，应通过友好协商解决。协商不成的，应向相关机构提起诉讼。<br />\r\n<br />\r\n众筹网未行使或执行本使用协议设定、赋予的任何权利，不构成对该等权利的放弃。<br />\r\n<br />\r\n本使用协议中的任何条款因与中华人民共和国法律相抵触而无效，并不影响其它条款的效力。<br />\r\n<br />\r\n本使用协议的标题仅供方便阅读而设，如与协议内容存在矛盾，以协议内容为准。<br />\r\n<br />\r\n举报<br />\r\n<br />\r\n如用户发现任何违反本服务条款的情事，请及时通知众筹网。<br />\r\n<br />', '21', '1413586458', '1413586458', '0', '1', '', '0', '0', '0', '7', '', '', '', '', '', '', '1', '1', '');
INSERT INTO `fanwe_article` VALUES ('76', '众筹平台助“印象”打造专业川菜连锁品牌', '三顾茅庐，方识茅庐真印象!目前已经拥有直营店的平台，10月18号将与平台投资人见面。<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img alt=\"\" src=\"http://www.renrentou.com/s/upload/editor/2014/10images/141016102309036310fuv8e.jpg\" style=\"height:427px;width:651px;\" /></p>\r\n<p><br />\r\n　　融资计划</p>\r\n<p><br />\r\n　众筹平台的建立，将进一步提高本服务水平</p>\r\n<p><br />\r\n　　项目特色</p>\r\n<p><br />\r\n　项目特色信息</p>\r\n<p><br />\r\n　　项目背景</p>\r\n<p>　跨济南、济区域，并保持良好增长势头。广大爱好美食的投资朋友们，这样好的赚钱投资机会你想拥有吗?赶紧关注众筹平台吧。<br />\r\n　　</p>\r\n<p><br />\r\n　　市场优势</p>\r\n<p><br />\r\n　　拥有多年品牌积淀，就餐环境良好好，价格符合大众消费，是商场餐饮业市场中目前仅有的大众定位的川菜连锁品牌。另外，印象中央厨房的可复制性研发，品牌发展及品质保证，开业即火爆，市场潜力巨大。目前，印象已跨济南、济区域，并保持良好增长势头。广大爱好美食的投资朋友们，这样好的赚钱投资机会你想拥有吗?赶紧关注众筹平台吧。</p>\r\n', '26', '1413586791', '1414802694', '0', '1', '', '0', '0', '0', '8', '', '', '', '', '众筹平台助“印象”打造专业川菜连锁品牌123', '', '1', '1', '');
