INSERT INTO `fanwe_deal_msg_list` VALUES ('436267', 'lwcc2@qq.com', '1', '<table cellpadding=\"0\" cellspacing=\"0\" bgcolor=\"\" width=\"100%\" style=\"background:#ffffff;\" class=\"baidu_pass\">\r\n<tbody>\r\n  <tr>\r\n    <td>\r\n    <table cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n        <tbody>\r\n   <tr>\r\n      <td style=\"background:#ffffff;border-bottom:2px solid #dfdfdf;width:15px;\">&nbsp;</td>\r\n      <td style=\"background:#ffffff;border-bottom:2px solid #ffffff;width:10px;\">&nbsp;</td>\r\n      <td style=\"background:#ffffff;width:137px;\"><img src=\"http://t1.fanwe.net:93/zc/public/attachment/201410/27/09/544da0aac3d17.png\" class=\"logo\" ellpadding=\"0\" cellspacing=\"0\"></td>\r\n     <td style=\"background:#ffffff;border-bottom:2px solid #ffffff;width:10px;\">&nbsp;</td>\r\n      <td style=\"background:#ffffff;border-bottom:2px solid #dfdfdf;\">&nbsp;</td>\r\n   </tr>\r\n        </tbody>\r\n   </table>\r\n    </td>\r\n </tr>\r\n <tr>\r\n    <td>\r\n    <table cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n        <tbody>\r\n   <tr>\r\n      <td width=\"25px;\" style=\"width:25px;\"></td>\r\n     <td align=\"\">\r\n       <div style=\"line-height:40px;height:40px;\"></div>\r\n       <p style=\"margin:0px;padding:0px;\"><strong style=\"font-size:14px;line-height:24px;color:#333333;font-family:arial,sans-serif;\">亲爱的用户：</strong></p>\r\n        <p style=\"margin:0px;padding:0px;line-height:24px;font-size:12px;color:#333333;font-family:\'宋体\',arial,sans-serif;\">您好！</p>\r\n        <p style=\"margin:0px;padding:0px;line-height:24px;font-size:12px;color:#333333;font-family:\'宋体\',arial,sans-serif;\">您于 2015年01月27日 18时09分 进行投资人申请，很高兴您审核通过,点击以下链接，即可进行下一步操作：</p>\r\n       <p style=\"margin:0px;padding:0px;\"><a href=\"http://t1.fanwe.net:93/zc/account\" style=\"line-height:24px;font-size:12px;font-family:arial,sans-serif;color:#0000cc\" target=\"_blank\">http://t1.fanwe.net:93/zc/account</a></p>\r\n       <p style=\"margin:0px;padding:0px;line-height:24px;font-size:12px;color:#979797;font-family:arial,sans-serif;\">(如果您无法点击此链接，请将它复制到浏览器地址栏后访问)</p>\r\n        <div style=\"line-height:80px;height:80px;\"></div>\r\n         <p style=\"margin:0px;padding:0px;line-height:24px;font-size:12px;color:#333333;font-family:\'宋体\',arial,sans-serif;\"><span style=\"border-bottom:1px dashed #ccc;\" t=\"5\" times=\"\">2015年01月27日</span></p>\r\n     </td>\r\n   </tr>\r\n   </tbody>\r\n    </table>\r\n    </td>\r\n </tr>\r\n <tr>\r\n    <td>\r\n      <table cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" style=\"border-top:1px solid #dfdfdf\">\r\n     <tbody>\r\n     <tr>\r\n        <td width=\"25px;\" style=\"width:25px;\"></td>\r\n       <td align=\"\">\r\n         <div style=\"line-height:40px;height:40px;\"></div>\r\n         <p style=\"margin:0px;padding:0px;line-height:24px;font-size:12px;color:#979797;font-family:\'宋体\',arial,sans-serif;\">若您没有注册过方维众筹帐号，请忽略此邮件，此帐号将不会被激活，由此给您带来的不便请谅解。</p>\r\n       </td>\r\n     </tr>\r\n     </tbody>\r\n      </table>\r\n    </td>\r\n </tr>\r\n</tbody>\r\n</table>', '1422324588', '1', '1422324588', '267', '发件失败的收件人地址lwcc2@qq.com', '0', '1', '方维众筹帐号-投资人审核通过', '0', '0');
