INSERT INTO `fanwe_help` VALUES ('4', '关于我们', '<span style=\"color:#555555;font-family:u5faeu8f6fu96c5u9ed1, 微软雅黑, tahoma, arial, 宋体, sans-serif;font-size:14px;line-height:22px;\">众筹，译自国外crowdfunding，即大众筹资或群众筹资。现代众筹指通过互联网方式发布筹款项目并募集资金。筹款项目成功后，项目发起人将会给予支持者对等的回报。回报方式可以是实物，也可以是服务。</span>', 'about', '', '1', '1');
