INSERT INTO `fanwe_sql_check` VALUES ('5770', 'deals', 'index', 'deals-index', 'type', 'deals-index-type', '20', 'a:21:{i:0;s:55:\"select * from zczc_user where id = 17 and is_effect = 1\";i:1;s:45:\"select level from zczc_user_level where id=10\";i:2;s:60:\"select * from zczc_nav where is_effect = 1 order by sort asc\";i:3;s:41:\"select * from zczc_help order by sort asc\";i:4;s:108:\"delete from zczc_deal_order where order_status = 0 and credit_pay = 0 and  1422496373 - create_time > 259200\";i:5;s:37:\"select count(*) from zczc_deal_notify\";i:6;s:72:\"select count(*) from zczc_user_notify where user_id = 17 and is_read = 0\";i:7;s:73:\"select count(*) from zczc_user_message where user_id = 17 and is_read = 0\";i:8;s:249:\"select ac.*,fa.num from zczc_article_cate as ac left join (SELECT count(*) as num,cate_id from zczc_article where is_effect=1 and is_delete=0 GROUP BY cate_id) as fa on fa.cate_id=ac.id  where ac.is_effect=1 and  ac.is_delete=0  order by ac.sort asc\";i:9;s:80:\"select * from zczc_article where is_effect=1 and is_delete=0 order by sort desc \";i:10;s:83:\"SELECT * FROM zczc_payment_notice where is_mortgate=1 and is_paid=1 and order_id=0 \";i:11;s:99:\"select * from zczc_link where is_effect = 1 and show_index = 1 and group_id = 14 order by sort desc\";i:12;s:64:\"select * from zczc_deal_cate where is_delete=0 order by sort asc\";i:13;s:66:\"select province from zczc_deal group by province order by sort asc\";i:14;s:149:\"select rc.* from zczc_region_conf as rc where rc.name in (select province from zczc_deal) or  rc.name in (select city from zczc_deal) or rc.is_hot=1 \";i:15;s:277:\"select count(*)  from zczc_deal as d  where  1=1 AND d.is_delete = 0 AND d.is_effect = 1   AND  d.is_delete = 0 and d.is_effect = 1  and d.cate_id in (5,8,1,2,3,4,6,7,14,17,21,24,25,26,27,28,31,32,36) and type=1  AND (d.user_level =\'\' or d.user_level=0 or d.user_level <=10)   \";i:16;s:30:\"select * from zczc_deal_level \";i:17;s:304:\"select d.* from zczc_deal  as d   where  1=1 AND d.is_delete = 0 AND d.is_effect = 1   AND  d.is_delete = 0 and d.is_effect = 1  and d.cate_id in (5,8,1,2,3,4,6,7,14,17,21,24,25,26,27,28,31,32,36) and type=1  AND (d.user_level =\'\' or d.user_level=0 or d.user_level <=10)    ORDER BY  sort asc  LIMIT 0,12\";i:18;s:84:\"select * from zczc_adv where tmpl=\'fanwe_1\' and adv_id=\'deals_top\' and is_effect = 1\";i:19;s:28:\"select * from zczc_api_login\";i:20;s:96:\"select sql_num from zczc_sql_check where module_action_para=\'deals-index-type\' order by id desc \";}', '1.398144', '2.753257', '3.9900', '0', 'http://t1.fanwe.net:93/zc/index.php?ctl=deals&type=1', 'index.php', '1422496376');
